import React, { useEffect, useState } from 'react'

import Axios from "axios"


export const Odontograma = (props) => {
    const {rut} = props

    const [historialRegistros, sethistorialRegistros] = useState("")

    useEffect(() => {
        Axios.get(`https://api-rest-cfedent.herokuapp.com/odontograma/${rut}`).then( (response) =>{
            sethistorialRegistros(response.data)
        })

    }, [])
    console.log(historialRegistros)

    return (
        <div className="container-fluid">
            <div className="row text-center mt-5 ">
                <div className="col-12 ">
                <table className="cinereousTable ">
                    <thead>
                        <tr>
                        <th scope="col" >Pieza</th>
                        <th scope="col">Cara</th>
                        <th scope="col">Diagnostico</th>
                        <th scope="col">Procedimiento</th>
                        <th scope="col">Fecha</th>
                        </tr>
                    </thead>
                    <tbody>
                        {historialRegistros.map( (hist, i) => {
                            return (
                            <>
                                <tr key = {i}>
                                    <td className="fuente-2">{hist.fecha}</td>
                                    <td className="fuente-2">{hist.pieza}</td>
                                    <td className="fuente-2">{hist.cara}</td>
                                    <td className="fuente-2">{hist.diagnostico}</td>
                                    <td className="fuente-2">{hist.procedimiento}</td>


                                </tr>

                            </>
                            )

                        })}

                    </tbody>
                </table>
                </div>        
            </div>



        </div>

    )
}
